  return (
    <div className="btn-group" role="group" aria-label="Basic radio toggle button group">
      <input type="radio" class="btn-check" name="status" id="all" />
      <label className="btn btn-outline-dark shadow-none" htmlFor="all">
        Radio 1
      </label>
    </div>
  );
}
